import React from "react";
import Button from '@mui/material/Button';
import NavBar from "./NavBar";
import WhatsAppIcon from '@mui/icons-material/WhatsApp';
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import InstagramIcon from '@mui/icons-material/Instagram';
import FacebookRoundedIcon from '@mui/icons-material/FacebookRounded';
function Home() {
  return (
    <div>
      <NavBar />
      <section className=" text-light mt-5">
        <div className="container">
          <div className="row">
            <div className="col-6">
              <h3> Hello ,it's Me </h3>
              <h2> Elhaddad Abdelmounaim </h2>
              <h2> And I'm a
                <span style={{ color: "#04BFCE" }}>
                  full-stack developer
                </span>
              </h2>
              <p className="mt-4">
                Lorem ipsum dolor sit, amet consectetur adipisicing elit. Facere
                vero debitis autem veritatis ut, provident minus quae expedita
                culpa ipsam!
              </p>
              <div className="my-2">
                <span className="ms-1" style={{cursor:"pointer"}}> <WhatsAppIcon sx={{ fontSize: 40 }} color="success" /> </span>
                <span className="ms-1" style={{cursor:"pointer"}}><GitHubIcon sx={{ fontSize: 40 }}  /></span>
                <span className="ms-1" style={{cursor:"pointer"}}><LinkedInIcon sx={{ fontSize: 40 }}  /></span>
                <span className="ms-1" style={{cursor:"pointer"}}><InstagramIcon sx={{ fontSize: 40 }} /></span>
                <span className="ms-1" style={{cursor:"pointer"}}><FacebookRoundedIcon sx={{ fontSize: 40 }}  /></span>
              </div>
              div
            </div>
            <div className="col-6"> img </div>
          </div>
        </div>
      </section>
    </div>
  );
}

export default Home;
